---@field order number 界面层级，低层面板Order(0 - 10000)，高层面板Order(100000 - 200000),只有明确需要指定层级的界面才配，其他界面按照先来后到的顺序显示
---@field cache boolean (可选)面板关闭的时候界面缓存，下次打开会很快，除了玩家常用的大厅界面，其他的不建议缓存
---@field layout Enum.EUILayout （全屏界面必填）界面布局类型
---@field scenename string （可选）场景名称
---@field auth string (必填)程序负责人
